import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  return (
    <div className={s.dialog + " " + s.active}>
      <NavLink to="/dialogs/1">{props.name}</NavLink>
    </div>
  );
};

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <DialogItem name="Vadick" />
        <div className={s.dialog}>
          <NavLink to="/dialogs/2">Alina</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/3">Chesterock</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/4">Puppy</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/5">Another Puppy</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/6">Cherepashka</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/7">Another cat</NavLink>
        </div>
      </div>
      <div className={s.messages}>
        <div className={s.message}>Hi</div>
        <div className={s.message}>Mew mew</div>
        <div className={s.message}>Bark bark</div>
      </div>
    </div>
  );
};

export default Dialogs;
